import React, { Component }  from 'react';
import { Route, BrowserRouter  as Router, Switch } from 'react-router-dom';
import Home from './/Home';


class Main extends Component {

    render(){

        return (
            <div className="App">
                <Router>
                    <Switch>
                        <Route exact path="/" component={Home} />
                    </Switch>
                </Router>
            </div>
        );
    }
}


export default Main
